import React from 'react';
import Image from 'next/image';
import ProductCard from '../components/ProductCard';

const products = [
  {
    id: 1,
    name: 'Cantilever Chair 1',
    description: 'A stylish and comfortable chair.',
    price: 300,
    image: '/images/chair1.jpg',
  },
  {
    id: 2,
    name: 'Cantilever Chair 2',
    description: 'Another stylish and comfortable chair.',
    price: 250,
    image: '/images/chair2.jpg',
  },
  // Add more products here
];

function Home() {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-8">Trending Products</h1>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4">
        {products.map((product) => (
          <ProductCard key={product.id} {...product} />
        ))}
      </div>

      <div className="mt-8 grid grid-cols-1 sm:grid-cols-2 gap-4">
        <div className="bg-pink-100 p-4 rounded-lg shadow-md">
          <h2 className="text-lg font-bold">23% off in all products</h2>
          <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mt-2">
            Shop Now
          </button>
          <Image
            src="/images/clock.jpg"
            alt="Clock"
            width={200}
            height={200}
            className="mt-4"
          />
        </div>
        <div className="bg-pink-100 p-4 rounded-lg shadow-md">
          <h2 className="text-lg font-bold">23% off in all products</h2>
          <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mt-2">
            View Collection
          </button>
          <Image
            src="/images/tv-stand.jpg"
            alt="TV Stand"
            width={200}
            height={200}
            className="mt-4"
          />
        </div>
      </div>
    </div>
  );
}

export default Home;
